code.value:
rfe_rxSelect_t rxSelect = RFE_RX_SELECT_NONE;

RFE_ERROR_GUARD
{
    switch ( pdcIndex )
    {
        case rfe_rxIndex_1_e:
            rxSelect = RFE_RX_SELECT_1;
            break;
        case rfe_rxIndex_2_e:
            rxSelect = RFE_RX_SELECT_2;
            break;
        case rfe_rxIndex_3_e:
            rxSelect = RFE_RX_SELECT_3;
            break;
        case rfe_rxIndex_4_e:
            rxSelect = RFE_RX_SELECT_4;
            break;
        default:
            RFE_ERROR_SET( rfe_error_pcdIndexInvalid_e );
            break;
    }
}

return rxSelect;

RFE_ERROR_GUARD
{
    usePdcMulticastAddr = ( enable == true );
}

rfeHwSpi_module_t pdcSpiModuleToUse = ( rfeHwSpi_module_t ) 0xfful;

RFE_ERROR_GUARD
{
    switch ( pdcIndex )
    {
        case rfe_rxIndex_1_e:
            pdcSpiModuleToUse = RFE_HW_SPI_PDC_1_MODULE;
            break;
        case rfe_rxIndex_2_e:
            pdcSpiModuleToUse = RFE_HW_SPI_PDC_2_MODULE;
            break;
        case rfe_rxIndex_3_e:
            pdcSpiModuleToUse = RFE_HW_SPI_PDC_3_MODULE;
            break;
        case rfe_rxIndex_4_e:
            pdcSpiModuleToUse = RFE_HW_SPI_PDC_4_MODULE;
            break;
        default:
            RFE_ERROR_SET( rfe_error_pcdIndexInvalid_e );
            break;
    }
}

return pdcSpiModuleToUse;

rfeHwSpi_offset_t pdcCtlOffset = 0x0u;

RFE_ERROR_GUARD
{
    switch ( pdcProfileIndex )
    {
        case rfeHw_profileIndex_0_e:
            pdcCtlOffset = RFE_HW_PDC_P0_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_1_e:
            pdcCtlOffset = RFE_HW_PDC_P1_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_2_e:
            pdcCtlOffset = RFE_HW_PDC_P2_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_3_e:
            pdcCtlOffset = RFE_HW_PDC_P3_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_4_e:
            pdcCtlOffset = RFE_HW_PDC_P4_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_5_e:
            pdcCtlOffset = RFE_HW_PDC_P5_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_6_e:
            pdcCtlOffset = RFE_HW_PDC_P6_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_7_e:
            pdcCtlOffset = RFE_HW_PDC_P7_PDC_CTL0_REG;
            break;
        case rfeHw_profileIndex_bist_e:
            pdcCtlOffset = RFE_HW_PDC_P8_PDC_CTL0_REG;
            break;
        default:
            RFE_ERROR_SET( rfe_error_pcdProfileIndexInvalid_e );
            break;
    }
}
return pdcCtlOffset;

rfeHwSpi_register32_t outPdcCtl3eg = inPdcCtl3Reg;

RFE_ERROR_GUARD
{
    if ( true == disable )
    {
        outPdcCtl3eg = rfeHwSpi_util_setBit( outPdcCtl3eg,
                                             RFE_HW_PDC_PDC_CTL3_DATA_OUT_0_BIT );
    }
    else
    {
        outPdcCtl3eg = rfeHwSpi_util_clearBit( outPdcCtl3eg,
                                               RFE_HW_PDC_PDC_CTL3_DATA_OUT_0_BIT );
    }
}

return outPdcCtl3eg;

RFE_ERROR_GUARD
{
    // Select the PDC to use
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    // Get register to bypass filters
    rfeHwSpi_register32_t pdcImagOutReg = rfeHwSpi_read( pdcAddrSPI,
                                                         RFE_HW_PDC_PDC_CTL4_REG,
                                                         RFE_ERROR_FUNCTION_ARGUMENT );

    pdcImagOutReg = rfeHwSpi_util_modifyBit( pdcImagOutReg,
                                             RFE_HW_PDC_PDC_CTL4_IMAG_OUT_EN_BIT,
                                             enable );

    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    RFE_HW_PDC_PDC_CTL4_REG,
                    pdcImagOutReg,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Get register to bypass filters
rfeHwSpi_register32_t pdcDcNotch2Reg = rfeHwSpi_read( pdcAddrSPI,
                                                      RFE_HW_PDC_PDC_DC_NOTCH2_REG,
                                                      RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Set dc notch filter cutoff frequency
    pdcDcNotch2Reg = rfeHwSpi_util_modifyShifted( pdcDcNotch2Reg,
                                                         RFE_HW_PDC_PDC_DC_NOTCH2_DC_NOTCH_COEFF_MSK,
                                                         ( rfeHwSpi_register32_t ) dcNotchCoeff,
                                                         RFE_HW_PDC_PDC_DC_NOTCH2_DC_NOTCH_COEFF_SHF );

}
// Write register to control DC notch filter cutoff freq
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_DC_NOTCH2_REG,
                pdcDcNotch2Reg,
                RFE_ERROR_FUNCTION_ARGUMENT );

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Get register to bypass filters
rfeHwSpi_register32_t pdcBypassesReg = rfeHwSpi_read( pdcAddrSPI,
                                                      RFE_HW_PDC_PDC_BYPASSES_REG,
                                                      RFE_ERROR_FUNCTION_ARGUMENT );
// Get register to control DC notch filter
rfeHwSpi_register32_t pdcDcNotch1Reg = rfeHwSpi_read( pdcAddrSPI,
                                                      RFE_HW_PDC_PDC_DC_NOTCH1_REG,
                                                      RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    /**
     * To disable the DC notch filter, we need first to enable the bypass of the notch filter itself and later disable it
     * When enabling the DC notch filter, we need to set its cutoff, hence we need to call rfeHwPdc_dcNotchFilterCoeffSetter()
     */
    if ( true == disableNotchFilter )
    {
        // Bypass DC notch
        pdcBypassesReg = rfeHwSpi_util_setBit( pdcBypassesReg,
                                               RFE_HW_PDC_PDC_BYPASSES_BYPASS_DC_NOTCH_BIT );
        // Disable DC notch
        pdcDcNotch1Reg = rfeHwSpi_util_setBit( pdcDcNotch1Reg,
                                               RFE_HW_PDC_PDC_DC_NOTCH1_DC_NOTCH_DIS_BIT );
    }
    else
    {
        // Disable Bypass DC notch
        pdcBypassesReg = rfeHwSpi_util_clearBit( pdcBypassesReg,
                                                 RFE_HW_PDC_PDC_BYPASSES_BYPASS_DC_NOTCH_BIT );
        // Enable  DC notch
        pdcDcNotch1Reg = rfeHwSpi_util_clearBit( pdcDcNotch1Reg,
                                                 RFE_HW_PDC_PDC_DC_NOTCH1_DC_NOTCH_DIS_BIT );

        // IF we enable the DC notch filter we have to set cutoff frequency. This function below consumes 2 SPI transactions
        rfeHwPdc_dcNotchFilterCoeffSetter( pdcIndex,
                                                dcNotchCoeff,
                                                RFE_ERROR_FUNCTION_ARGUMENT );
    }

}

// Write register to bypass filters
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_BYPASSES_REG,
                pdcBypassesReg,
                RFE_ERROR_FUNCTION_ARGUMENT );
// Write register to control DC notch filter
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_DC_NOTCH1_REG,
                pdcDcNotch1Reg,
                RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Select the PDC to use
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    // Select CTL0 register based on profile
    rfeHwSpi_offset_t pdcCtlOffset = rfeHwPdc_ctl0SelectorForProfile( pdcProfileIndex,
                                                                      RFE_ERROR_FUNCTION_ARGUMENT );

    // Read PDC CTL register to set sampling rate
    rfeHwSpi_register32_t pdcCtl0Fs = rfeHwSpi_read( pdcAddrSPI,
                                                     pdcCtlOffset,
                                                     RFE_ERROR_FUNCTION_ARGUMENT );

    // Add sampling rate
    pdcCtl0Fs = rfeHwSpi_util_modifyShifted( pdcCtl0Fs,
                                             RFE_HW_PDC_COMMON_SAMPLING_RATE_MASK,
                                             RFE_HW_PDC_CUSTOMER_SAMPLING_RATE_INDEX_TO_HW_SAMPLING_RATE_INDEX(pdcOutputSamplingRate),
                                             RFE_HW_PDC_COMMON_SAMPLING_RATE_SHF );

    // Write the sampling rate to use
    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    pdcCtlOffset,
                    pdcCtl0Fs,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    if (rxSelect == RFE_RX_SELECT_ALL)
    {
        // Enable multicast SPI write
        rfeHwPdc_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
        rfeHwPdc_setSamplingRate( rfe_rxIndex_1_e, pdcProfileIndex, pdcOutputSamplingRate, RFE_ERROR_FUNCTION_ARGUMENT );
        // Disable multicast SPI write
        rfeHwPdc_multicastModeSetter( false, RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        for( uint8_t rxId = 0u; rxId < RFE_RX_COUNT; rxId++ )
        {
            if( 1u == ( (rxSelect >> rxId) & 1u ) )
            {
                rfeHwPdc_setSamplingRate( (rfe_rxIndex_t) rxId, pdcProfileIndex, pdcOutputSamplingRate, RFE_ERROR_FUNCTION_ARGUMENT );
            }
        }
    }
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// To control DATA_OUT_0
rfeHwSpi_register32_t pdcCtl3 = rfeHwSpi_read( pdcAddrSPI,
                                               RFE_HW_PDC_PDC_CTL3_REG,
                                               RFE_ERROR_FUNCTION_ARGUMENT );

// To control IMAG_OUT_EN and ADC_RAW_EN
rfeHwSpi_register32_t pdcCtl4 = rfeHwSpi_read( pdcAddrSPI,
                                               RFE_HW_PDC_PDC_CTL4_REG,
                                               RFE_ERROR_FUNCTION_ARGUMENT );

// To control VAL_MUXers we only use VAL_MUX in PDC2
rfeHwSpi_register32_t pdcValMux1 = rfeHwSpi_read( rfeHwPdc_indexMapperToSPIModule( rfe_rxIndex_2_e,
                                                                                   RFE_ERROR_FUNCTION_ARGUMENT ),
                                                  RFE_HW_PDC_PDC_VAL_MUX1_REG,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );


RFE_ERROR_GUARD
{
    // Set ADC_RAW_EN to zero
    pdcCtl4 = rfeHwSpi_util_clearBit( pdcCtl4,
                                      RFE_HW_PDC_PDC_CTL4_ADC_RAW_EN_BIT );

    // Set DATA_OUT_0 to have always output
    pdcCtl3 = rfeHwPdc_dataOutputToZeroSetter( pdcCtl3,
                                               false,
                                               RFE_ERROR_FUNCTION_ARGUMENT );

    // Variable to store the other PDC unit that we may need to reach for IQ and Q modes
    rfe_rxIndex_t counterpartPdcIndex;
    if ( pdcIndex == rfe_rxIndex_2_e || pdcIndex == rfe_rxIndex_4_e )
    {

        counterpartPdcIndex = pdcIndex - 1ul;
    }
    else
    {
        counterpartPdcIndex = pdcIndex + 1ul;
    }

    switch ( selectedOutput )
    {
        case rfeHwPdc_pdcOutput_I_e:
            /**
             * 1. disable the Q component in Output unit via IMAG_OUT_EN
             * 2. enable the I component in VAL_MUX2
             */
            pdcCtl4 = rfeHwSpi_util_clearBit( pdcCtl4,
                                              RFE_HW_PDC_PDC_CTL4_IMAG_OUT_EN_BIT );
            pdcValMux1 = rfeHwSpi_util_clearBit( pdcValMux1,
                                                 RFE_HW_PDC_COMMON_VAL_MUX_INDEX_BIT( pdcIndex ) );

            break;
        case rfeHwPdc_pdcOutput_Q_e:

            /**
             * 1. enable the Q component in Output unit
             * 2. enable(set 1) the Q component in VAL_MUX1.VAL_MUXx of PDC2 of the counterpart PDC( that actually controls Q component of requested PDC)
             * 3. disable Q in the Output Unit(setting it to zero) and enable the VAL_MUX to show Q, which will be zero
             *    we need a SPI transfer (read/write) for this since we need to reach the other PDC unit
             * 4. Set VAL_MUX1.VAL_MUX(pdcIndex) of PDC2 to one, meaning that Q component of counter part will be routed but it will be zero since in step 3 we have
             *    disabled RFE_HW_PDC_PDC_CTL4_IMAG_OUT_EN_BIT
             */
            // 1.
            pdcCtl4 = rfeHwSpi_util_setBit( pdcCtl4,
                                            RFE_HW_PDC_PDC_CTL4_IMAG_OUT_EN_BIT );

            // 2.
            pdcValMux1 = rfeHwSpi_util_setBit( pdcValMux1,
                                               RFE_HW_PDC_COMMON_VAL_MUX_INDEX_BIT( counterpartPdcIndex ) );
            //3. Disable Q in the Output Unit(setting it to zero) of the counterpart PDC and enable the VAL_MUX to show Q, which will be zero
            rfeHwPdc_qComponentEnabledViaSpi( counterpartPdcIndex,
                                              false,
                                              RFE_ERROR_FUNCTION_ARGUMENT );
            //4.
            pdcValMux1 = rfeHwSpi_util_setBit( pdcValMux1,
                                               RFE_HW_PDC_COMMON_VAL_MUX_INDEX_BIT( pdcIndex ) );

            break;
        case rfeHwPdc_pdcOutput_IQ_e:
            /**
             * 1. enable(set 1) the Q component in Output unit
             * 2. enable(set 1) the Q component in VAL_MUX1.VAL_MUXx of PDC2
             * 3. enable(set 0) the I component in VAL_MUX1.VAL_MUXx of PDC2
             */
            // 1.
            pdcCtl4 = rfeHwSpi_util_setBit( pdcCtl4,
                                            RFE_HW_PDC_PDC_CTL4_IMAG_OUT_EN_BIT );

            // 2.
            pdcValMux1 = rfeHwSpi_util_setBit( pdcValMux1,
                                                RFE_HW_PDC_COMMON_VAL_MUX_INDEX_BIT( counterpartPdcIndex ) );

            // 3.
            pdcValMux1 = rfeHwSpi_util_clearBit( pdcValMux1,
                                                 RFE_HW_PDC_COMMON_VAL_MUX_INDEX_BIT( pdcIndex ) );
            break;
        default:
            RFE_ERROR_SET( rfe_error_pcdSlectedInputNotImplemented_e );
            break;
    }
}

// To write DATA_OUT_0
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_CTL3_REG,
                pdcCtl3,
                RFE_ERROR_FUNCTION_ARGUMENT );

// To write IMAG_OUT_EN and ADC_RAW_EN
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_CTL4_REG,
                pdcCtl4,
                RFE_ERROR_FUNCTION_ARGUMENT );

// To write VAL_MUXers
rfeHwSpi_write( rfeHwPdc_indexMapperToSPIModule( rfe_rxIndex_2_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT ),
                RFE_HW_PDC_PDC_VAL_MUX1_REG,
                pdcValMux1,
                RFE_ERROR_FUNCTION_ARGUMENT );

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Select CTL0 register based on profile
rfeHwSpi_offset_t pdcCtlOffset = rfeHwPdc_ctl0SelectorForProfile( pdcProfileIndex,
                                                                  RFE_ERROR_FUNCTION_ARGUMENT );

// Read PDC CTL register to set k0xa0Imag (coeff3)
rfeHwSpi_register32_t pdcCtl0 = rfeHwSpi_read( pdcAddrSPI,
                                               pdcCtlOffset,
                                               RFE_ERROR_FUNCTION_ARGUMENT );

// Read PDC CTL register to set k0xa1 (coeff1) and set k0xa0Real (coeff2)
rfeHwSpi_register32_t pdcEq1 = rfeHwSpi_read( pdcAddrSPI,
                                              pdcCtlOffset + RFE_HW_PDC_COMMON_EQ1_REG_OFFSET,
                                              RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Set k0xa1 (coeff1)
    pdcEq1 = rfeHwSpi_util_modifyShifted( pdcEq1,
                                          RFE_HW_PDC_COMMON_EQ_COEFF1_MSK,
                                          ( rfeHwSpi_register32_t ) eqCoeffs.k0xa1,
                                          RFE_HW_PDC_COMMON_EQ_COEFF1_SHF );

    // Set k0xa0Real (coeff2)
    pdcEq1 = rfeHwSpi_util_modifyShifted( pdcEq1,
                                          RFE_HW_PDC_COMMON_EQ_COEFF2_MSK,
                                          ( rfeHwSpi_register32_t ) eqCoeffs.k0xa0Real,
                                          RFE_HW_PDC_COMMON_EQ_COEFF2_SHF );

    // Set k0xa0Imag (coeff3)
    pdcCtl0 = rfeHwSpi_util_modifyShifted( pdcCtl0,
                                           RFE_HW_PDC_COMMON_EQ_COEFF3_MSK,
                                           ( rfeHwSpi_register32_t ) eqCoeffs.k0xa0Imag,
                                           RFE_HW_PDC_COMMON_EQ_COEFF3_SHF );
}

// Write PDC CTL register to set k0xa0Imag (coeff3)
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                pdcCtlOffset,
                pdcCtl0,
                RFE_ERROR_FUNCTION_ARGUMENT );

// Write  PDC CTL register to set k0xa1 (coeff1) and set k0xa0Real (coeff2)
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                pdcCtlOffset + RFE_HW_PDC_COMMON_EQ1_REG_OFFSET,
                pdcEq1,
                RFE_ERROR_FUNCTION_ARGUMENT );

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwSpi_register32_t pdcPhAmpCorrReg = RFE_HW_PDC_INVALID_REG_CONTENT;

// We only have 12bits (signed) for phase correction, we need to check that the value is not using more than 12bits
if ( ( pdcPhaseCorrectionParams.pdcPhaseCorrection_I < RFE_HW_PDC_FIXED_POINT_POWER_OF_TWO( RFE_HW_PDC_P0_PDC_PHAMP_COR_PDC_PHASE_COR_I_LEN ) ) &&
     ( pdcPhaseCorrectionParams.pdcPhaseCorrection_Q < RFE_HW_PDC_FIXED_POINT_POWER_OF_TWO( RFE_HW_PDC_P0_PDC_PHAMP_COR_PDC_PHASE_COR_Q_LEN ) ) )
{
    // Select register for PHAMP_COR
    pdcPhAmpCorrReg = RFE_HW_PDC_COMMON_PHAMP_COR_REG_OFFSET( pdcProfileIndex );

    // Read PDC CTL register to set phase amplitude correction
    rfeHwSpi_register32_t pdcPhAmpCorr = rfeHwSpi_read( pdcAddrSPI,
                                                        pdcPhAmpCorrReg,
                                                        RFE_ERROR_FUNCTION_ARGUMENT );

    RFE_ERROR_GUARD
    {
        // I-phase correction
        pdcPhAmpCorr = rfeHwSpi_util_modifyShifted( pdcPhAmpCorr,
                                                    RFE_HW_PDC_COMMON_PHAMP_COR_PDC_PHASE_COR_I_MSK,
                                                    ( rfeHwSpi_register32_t ) pdcPhaseCorrectionParams.pdcPhaseCorrection_I,
                                                    RFE_HW_PDC_COMMON_PHAMP_COR_PDC_PHASE_COR_I_SHF );

        // Q-phase correction
        pdcPhAmpCorr = rfeHwSpi_util_modifyShifted( pdcPhAmpCorr,
                                                    RFE_HW_PDC_COMMON_PHAMP_COR_PDC_PHASE_COR_Q_MSK,
                                                    ( rfeHwSpi_register32_t ) pdcPhaseCorrectionParams.pdcPhaseCorrection_Q,
                                                    RFE_HW_PDC_COMMON_PHAMP_COR_PDC_PHASE_COR_Q_SHF );

        // Level Adjustment
        pdcPhAmpCorr = rfeHwSpi_util_modifyShifted( pdcPhAmpCorr,
                                                    RFE_HW_PDC_COMMON_PHAMP_COR_LEVEL_ADJ_MSK,
                                                    ( rfeHwSpi_register32_t ) pdcPhaseCorrectionParams.pdcLevelAdjustment,
                                                    RFE_HW_PDC_COMMON_PHAMP_COR_PDC_LEVEL_ADJ_SHF );
    }

    // Write PDC CTL register to set phase correction
    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    pdcPhAmpCorrReg,
                    pdcPhAmpCorr,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}
else if(RFE_ERROR_IS_NO_ERROR)
{
    RFE_ERROR_SET( rfe_error_pcdPhaseCorrectionInvalid_e );
}
else
{
    // Propagate previous error
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Select register for ICQ REG
rfeHwSpi_register32_t pdcIcqReg = RFE_HW_PDC_COMMON_ICQ_REG_OFFSET( pdcProfileIndex );


// Read PDC CTL register to set ICQ phase/amplitude correction
rfeHwSpi_register32_t pdcIqCorr = rfeHwSpi_read( pdcAddrSPI,
                                                 pdcIcqReg,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // IQC amplitude correction
    pdcIqCorr = rfeHwSpi_util_modifyShifted( pdcIqCorr,
                                                    RFE_HW_PDC_COMMON_IQC_PDC_IQC_AMP_MSK,
                                                    ( rfeHwSpi_register32_t ) iqcAmpCorrection,
                                                    RFE_HW_PDC_COMMON_IQC_PDC_IQC_AMP_SHF );

    // ICQ phase correction
    pdcIqCorr = rfeHwSpi_util_modifyShifted( pdcIqCorr,
                                                    RFE_HW_PDC_COMMON_IQC_PDC_IQC_PHASE_MSK,
                                                    ( rfeHwSpi_register32_t ) iqcPhaseCorrection,
                                                    RFE_HW_PDC_COMMON_IQC_PDC_IQC_PHASE_SHF );

}

// Write PDC CTL register to set ICQ amplitude/phase correction
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                pdcIcqReg,
                pdcIqCorr,
                RFE_ERROR_FUNCTION_ARGUMENT );

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Read PDC CTL2 register to enable Fs/2
    rfeHwSpi_modifyBit( pdcAddrSPI,
                        RFE_HW_PDC_PDC_CTL2_REG,
                        RFE_HW_PDC_PDC_CTL2_FS_BY_2_SHIFT_BIT,
                        enable,
                        RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t filterMode;
    if ( rfe_pdcDecimationFilter_narrow_e == bandMode )
    {
        filterMode = 1ul;
    }
    else
    {
        filterMode = 2ul;
    }
    // Select the PDC to use
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    rfeHwSpi_register32_t pdcCtl4 = rfeHwSpi_read( pdcAddrSPI,
                                                    RFE_HW_PDC_PDC_CTL4_REG,
                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    pdcCtl4 = rfeHwSpi_util_modifyShifted( RFE_HW_PDC_PDC_CTL4_REG,
                                                RFE_HW_PDC_PDC_CTL4_FILTER_MODE_MSK,
                                                filterMode,
                                                RFE_HW_PDC_PDC_CTL4_FILTER_MODE_SHF );

    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    RFE_HW_PDC_PDC_CTL4_REG,
                    pdcCtl4,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    if (rxSelect == RFE_RX_SELECT_ALL)
    {
        // Enable multicast SPI write
        rfeHwPdc_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
        rfeHwPdc_pdcSetDecimationFilter( rfe_rxIndex_1_e, bandMode, RFE_ERROR_FUNCTION_ARGUMENT );
        // Disable multicast SPI write
        rfeHwPdc_multicastModeSetter( false, RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        for( uint8_t rxId = 0u; rxId < RFE_RX_COUNT; rxId++ )
        {
            if( 1u == ( (rxSelect >> rxId) & 1u ) )
            {
                rfeHwPdc_pdcSetDecimationFilter( (rfe_rxIndex_t) rxId, bandMode, RFE_ERROR_FUNCTION_ARGUMENT );
            }
        }
    }
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Read PDC CTL register to bypass filters
rfeHwSpi_register32_t pdcBypass = rfeHwSpi_read( pdcAddrSPI,
                                                 RFE_HW_PDC_PDC_BYPASSES_REG,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{

    /*
     * 1. Bypass ICQ
     * 2. Bypass DC Notch
     * 3. Bypass fsout/20 shift before Decimator 10/11
     * 4. Bypass fsout/20 shift after Decimator 10/11
     * 5. Bypass fsout/4 at the output
     * 6. Bypass CORDIC
     * 7. Bypass phase correction at the output
     */

    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_IQC_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_iqc_e ) );
    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_DC_NOTCH_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_dcNotch_e ) );
    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_FSHIFT1_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_fshift1_e ) );
    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_FSHIFT2_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_fshift2_e ) );

    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_FSHIFT3_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_fshift3_e ) );

    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_CORDIC_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_cordic_e ) );
    pdcBypass |= rfeHwSpi_util_modifyBit( pdcBypass,
                                          RFE_HW_PDC_PDC_BYPASSES_BYPASS_PH_COR_BIT,
                                          rfeHwSpi_util_getBit( ( rfeHwSpi_register32_t ) ( bypassFiltersMask & RFE_HW_PDC_BYPASS_FILTER_MSK ),
                                                                ( rfeHwSpi_registerBit_t ) rfeHwPdc_bypass_filter_phaseCorrection_e ) );

}
// Write PDC CTL register to bypass filters
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_BYPASSES_REG,
                pdcBypass,
                RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Select the PDC to use
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    rfeHwSpi_register32_t pdcCtl3 = rfeHwSpi_read( pdcAddrSPI,
                                                    RFE_HW_PDC_PDC_CTL3_REG,
                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    pdcCtl3 = rfeHwSpi_util_modifyShifted( RFE_HW_PDC_PDC_CTL3_REG,
                                            RFE_HW_PDC_PDC_CTL3_OUTP_ROUND_MSK,
                                            ( rfeHwSpi_register32_t ) ( rfe_pdcBitwidth_16bit_e - bitWidth ),
                                            RFE_HW_PDC_PDC_CTL3_OUTP_ROUND_SHF );

    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    RFE_HW_PDC_PDC_CTL3_REG,
                    pdcCtl3,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    if (rxSelect == RFE_RX_SELECT_ALL)
    {
        // Enable multicast SPI write
        rfeHwPdc_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
        rfeHwPdc_setBitWidth( rfe_rxIndex_1_e, bitWidth, RFE_ERROR_FUNCTION_ARGUMENT );
        // Disable multicast SPI write
        rfeHwPdc_multicastModeSetter( false, RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        for( uint8_t rxId = 0u; rxId < RFE_RX_COUNT; rxId++ )
        {
            if( 1 == ( (rxSelect >> rxId) & 1u ) )
            {
                rfeHwPdc_setBitWidth( (rfe_rxIndex_t) rxId, bitWidth, RFE_ERROR_FUNCTION_ARGUMENT );
            }
        }
    }
}

RFE_ERROR_GUARD
{
    rfeHwSpi_modify( rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                      RFE_ERROR_FUNCTION_ARGUMENT ),
                     RFE_HW_PDC_PDC_ADC_OL_CNT1_REG,
                     RFE_HW_PDC_PDC_ADC_OL_CNT1_ADC_OL_CNT_THRSH_MSK,
                     ( rfeHwSpi_register32_t ) ( pdcClippingCountLimit ),
                     RFE_ERROR_FUNCTION_ARGUMENT );
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Read PDC CTL register to bypass filters
rfeHwSpi_register32_t pdcClipDetReg = rfeHwSpi_read( pdcAddrSPI,
                                                     RFE_HW_PDC_PDC_CLIP_DET_REG,
                                                     RFE_ERROR_FUNCTION_ARGUMENT );
if ( true == resetClippingFlag )
{
    rfeHwSpi_register32_t pdcCtl6Reg = rfeHwSpi_read( pdcAddrSPI,
                                                      RFE_HW_PDC_PDC_CTL6_REG,
                                                      RFE_ERROR_FUNCTION_ARGUMENT );

    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    RFE_HW_PDC_PDC_CTL6_REG,
                    RFE_HW_PDC_COMMON_TOGGLE_BIT( pdcCtl6Reg,
                                                  RFE_HW_PDC_PDC_CTL6_CLIP_DET_RESET_BIT ),
                    RFE_ERROR_FUNCTION_ARGUMENT );
}
else
{
    // Do not reset the CTL6 register bit for clipping detector
}

return pdcClipDetReg;

if ( correlatorIntgTime < RFE_HW_PDC_FIXED_POINT_POWER_OF_TWO(RFE_HW_PDC_PDC_CTL3_PDC_CORREL_TIME_LEN) )
{
    // Select the PDC to use
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    // Read PDC CTL register for correlator
    rfeHwSpi_register32_t pdcCorr = rfeHwSpi_read( pdcAddrSPI,
                                                   RFE_HW_PDC_PDC_CTL3_REG,
                                                   RFE_ERROR_FUNCTION_ARGUMENT );

    RFE_ERROR_GUARD
    {

        if ( true == enableCorrelator )
        {
            pdcCorr = rfeHwSpi_util_setBit( pdcCorr,
                                            RFE_HW_PDC_PDC_CTL3_PDC_CORREL_EN_BIT );
            // Set correlator integration time
            pdcCorr = rfeHwSpi_util_modifyShifted( pdcCorr,
                                                   RFE_HW_PDC_PDC_CTL3_PDC_CORREL_TIME_MSK,
                                                   ( rfeHwSpi_register32_t ) correlatorIntgTime,
                                                   RFE_HW_PDC_PDC_CTL3_PDC_CORREL_TIME_SHF );
        }
        else
        {
            pdcCorr = rfeHwSpi_util_clearBit( pdcCorr,
                                              RFE_HW_PDC_PDC_CTL3_PDC_CORREL_EN_BIT );
        }

    }

    // Write PDC CTL register for correlator
    rfeHwSpi_clearBit( pdcAddrSPI,
                       RFE_HW_PDC_PDC_CTL3_REG,
                       pdcCorr,
                       RFE_ERROR_FUNCTION_ARGUMENT );
}
else if(RFE_ERROR_IS_NO_ERROR)
{
    RFE_ERROR_SET(rfe_error_pcdCorrelatorIntegrationTimeInvalid_e);
}
else
{
    // Propagate error to upper layer if there is one
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Read PDC correlator I output
*pCorrelatorOutputI = ( uint32_t ) rfeHwSpi_read( pdcAddrSPI,
                                                  RFE_HW_PDC_PDC_CORR_RI_REG,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );
// Read PDC correlator Q output
*pCorrelatorOutputQ = ( uint32_t ) rfeHwSpi_read( pdcAddrSPI,
                                                  RFE_HW_PDC_PDC_CORR_RQ_REG,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );

uint32_t pdcAdcOverloadCounter = 0x0ul;

// Select the PDC to use and read PDC CTL register for correlator
pdcAdcOverloadCounter = ( uint32_t ) rfeHwSpi_read( rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                                     RFE_ERROR_FUNCTION_ARGUMENT ),
                                                    RFE_HW_PDC_PDC_ADC_OL_CNT_REG,
                                                    RFE_ERROR_FUNCTION_ARGUMENT );
return pdcAdcOverloadCounter;

RFE_ERROR_GUARD { /** * Select first the desired output from the PDC muxers * Notice that this function is disabling ADC_RAW_EN which turns off the forwarding of fs = 160MHz to the output */ rfeHwPdc_outputSelector( pdcIndex, selectedOutput, RFE_ERROR_FUNCTION_ARGUMENT );
/** * Secondly,since previous call will always set ADC_RAW_EN to zero, * we call here the set of the sampling rate that will turn it on in case of choosing fs = 160MHz */ rfeHwPdc_dftSamplingRateSetter( pdcIndex, pdcProfileIndex, dftSettings.pdcOutputSamplingRate, dftSettings.useDeci12Filter, RFE_ERROR_FUNCTION_ARGUMENT );
/** * Thirdly, we enable DFT Muxer according to desired output */ rfeHwSpi_modify( rfeHwPdc_indexMapperToSPIModule( pdcIndex, RFE_ERROR_FUNCTION_ARGUMENT ), RFE_HW_PDC_PDC_VAL_MUX1_REG, RFE_HW_PDC_PDC_VAL_MUX1_DFT_OUT_MUX_MSK, ( ( rfeHwSpi_register32_t ) dftSettings.dfTSelectedOutput << RFE_HW_PDC_PDC_VAL_MUX1_DFT_OUT_MUX_SHF ), RFE_ERROR_FUNCTION_ARGUMENT );
}

rfeHwSpi_offset_t pdcCtlOffset;
rfeHwSpi_register32_t pdcCtl0Fs;

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );
rfe_rxSelect_t rxSelect = rfeHwPdc_getRxSelect(pdcIndex, RFE_ERROR_FUNCTION_ARGUMENT );
RFE_ERROR_GUARD
{

    /* Function dedicated to set or not on hold deci1 when working in Fs=80MSps. We need to add here before the switch
     * to ensure that any other sampling rate cofing does not put the deci1 on hold (=0). Thus we can re use the function
     * to restore original rates.
     */
    rfeHwPdc_dftDec1OnHold( pdcIndex,
                            true,
                            RFE_ERROR_FUNCTION_ARGUMENT );

    switch ( pdcOutputSamplingRate )
    {
        case rfeHwPdc_effectiveSamplingFrequency_160MHz_e:

            /**
             *  In order to have 160MHz I-ADC_RAW signal at the output of PDC,
             *  we don't need to assign it to a profile but directly via ADC_RAW_EN register
             */
            rfeHwSpi_setBit( pdcAddrSPI,
                             RFE_HW_PDC_PDC_CTL4_REG,
                             RFE_HW_PDC_PDC_CTL4_ADC_RAW_EN_BIT,
                             RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwPdc_effectiveSamplingFrequency_80MHz_e:

            // Select CTL0 register based on profile
            pdcCtlOffset = rfeHwPdc_ctl0SelectorForProfile( pdcProfileIndex,
                                                            RFE_ERROR_FUNCTION_ARGUMENT );

            // Read PDC CTL register to set sampling rate
            pdcCtl0Fs = rfeHwSpi_read( pdcAddrSPI,
                                       pdcCtlOffset,
                                       RFE_ERROR_FUNCTION_ARGUMENT );

            // Add sampling rate
            pdcCtl0Fs = rfeHwSpi_util_modifyShifted( pdcCtl0Fs,
                                                            RFE_HW_PDC_COMMON_SAMPLING_RATE_MASK,
                                                            ( rfeHwSpi_register32_t ) rfeHwPdc_effectiveSamplingFrequency_80MHz_e,
                                                            RFE_HW_PDC_COMMON_SAMPLING_RATE_SHF );

            // Write the sampling rate to use
            rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                            pdcCtlOffset,
                            pdcCtl0Fs,
                            RFE_ERROR_FUNCTION_ARGUMENT );

            // Enable or not deci12 filter
            rfeHwPdc_dftEnableDeci12Filter( pdcIndex,
                                            useDeci12Filter,
                                            RFE_ERROR_FUNCTION_ARGUMENT );

            break;
        case rfeHwPdc_effectiveSamplingFrequency_40MHz_e:
            rfeHwPdc_samplingRateSetter( rxSelect,
                                         pdcProfileIndex,
                                         rfe_effectiveSamplingFrequency_40MHz_e,
                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwPdc_effectiveSamplingFrequency_20MHz_e:
            rfeHwPdc_samplingRateSetter( rxSelect,
                                         pdcProfileIndex,
                                         rfe_effectiveSamplingFrequency_20MHz_e,
                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwPdc_effectiveSamplingFrequency_10MHz_e:
            rfeHwPdc_samplingRateSetter( rxSelect,
                                         pdcProfileIndex,
                                         rfe_effectiveSamplingFrequency_10MHz_e,
                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        default:
            RFE_ERROR_SET( rfe_error_pcdSamplingFrequencyInvalid_e );
            break;
    }
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );
rfeHwSpi_register32_t pdcOlCnt = rfeHwSpi_read( pdcAddrSPI,
                                                RFE_HW_PDC_PDC_PDC_OL_CNT_REG,
                                                RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    pdcOlCnt = rfeHwSpi_util_modifyBit( pdcOlCnt,
                                        RFE_HW_PDC_PDC_PDC_OL_CNT_DECI1_HLD_DIS_BIT,
                                        !enable);
}
rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                RFE_HW_PDC_PDC_PDC_OL_CNT_REG,
                pdcOlCnt,
                RFE_ERROR_FUNCTION_ARGUMENT );

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Read PDC CTL4 to set deci12 or not
    rfeHwSpi_register32_t pdcCtl4 = rfeHwSpi_read( pdcAddrSPI,
                                                   RFE_HW_PDC_PDC_CTL4_REG,
                                                   RFE_ERROR_FUNCTION_ARGUMENT );
    // Select what fs=80MHz path to select
    // Enable Deci12 Filter for validation and its path will be used (muxer will be accordingly selected)
    // By default we will use Deci11n,s filter path (muxer will be accordingly selected)
    pdcCtl4 = rfeHwSpi_util_modifyBit( pdcCtl4,
                                       RFE_HW_PDC_PDC_CTL4_FILT12_EN_BIT,
                                       enable == true );

    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    RFE_HW_PDC_PDC_CTL4_REG,
                    pdcCtl4,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    // We need to bypass cordic and Fshift3 to use Deci12
    if ( enable )
    {

        // Disable Cordic and Fshift3 for Deci12
        rfeHwPdc_bypassFilters( pdcIndex,
                                RFE_HW_PDC_BYPASS_FILTERS_FOR_FS_80MSPS_MSK,
                                RFE_ERROR_FUNCTION_ARGUMENT );

    }
    else
    {
        // Re-enable Cordic and Fshift3 if  Deci12 is disabled
        rfeHwSpi_register32_t pdcBypass = rfeHwSpi_read( pdcAddrSPI,
                                                         RFE_HW_PDC_PDC_BYPASSES_REG,
                                                         RFE_ERROR_FUNCTION_ARGUMENT );

        pdcBypass = rfeHwSpi_util_modifyBit( pdcBypass,
                                             RFE_HW_PDC_PDC_BYPASSES_BYPASS_FSHIFT3_BIT,
                                             false );

        pdcBypass = rfeHwSpi_util_modifyBit( pdcBypass,
                                             RFE_HW_PDC_PDC_BYPASSES_BYPASS_CORDIC_BIT,
                                             false );

        rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                        RFE_HW_PDC_PDC_BYPASSES_REG,
                        pdcBypass,
                        RFE_ERROR_FUNCTION_ARGUMENT );

    }
}

// Select the PDC to use
rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( pdcIndex,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

// Read PDC CTL4 to set EQ or not
rfeHwSpi_register32_t pdcCtl4 = rfeHwSpi_read( pdcAddrSPI,
                                               RFE_HW_PDC_PDC_CTL4_REG,
                                               RFE_ERROR_FUNCTION_ARGUMENT );
// Get PDC EQ current status
bool eqStatus = rfeHwSpi_util_getBit( pdcCtl4,
                                      RFE_HW_PDC_PDC_CTL4_EQ_EN_BIT );

RFE_ERROR_GUARD
{
    // Enable/disable the EQ
    pdcCtl4 = rfeHwSpi_util_modifyBit( pdcCtl4,
                                       RFE_HW_PDC_PDC_CTL4_EQ_EN_BIT,
                                       enable );

    rfeHwSpi_write( rfeHwPdc_indexMapperToMulticastModule( pdcAddrSPI ),
                    RFE_HW_PDC_PDC_CTL4_REG,
                    pdcCtl4,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    if ( RFE_ERROR_IS_NO_ERROR )
    {
        eqStatus = enable;
    }
    else
    {
        // Nothing do not update the value
    }
}

return eqStatus;

rfeHwSpi_register32_t regValue = 0ul;
regValue = rfeHwSpi_util_modifyBit( regValue, RFE_HW_PDC_PDC_CTL5_IQ_SWAP_IN_BIT, !iqSwapEnable );
regValue = rfeHwSpi_util_setBit( regValue, RFE_HW_PDC_PDC_CTL5_USE_SWAP_IN_REG_BIT );
regValue = rfeHwSpi_util_setBit( regValue, RFE_HW_PDC_PDC_CTL5_IQ_SWAP_OUT_AUT_BIT );
// All other register fields are intentionally set to their default 0 value (IQ_SWAP_OUT & DEBUG_PORT_EN)

rfeHwSpi_write( RFE_HW_SPI_PDC_MC_MODULE, RFE_HW_PDC_PDC_CTL5_REG, regValue, RFE_ERROR_FUNCTION_ARGUMENT );

/* We might be inducing an error here by setting the returned sampling rate to 160MHz, since this
 * sampling rate cannot be set by customer. However, the input is always overwritting this intial
 * value if no error is present
*/
rfeHwPdc_dftSamplingFrequency_t dftSamplingRate = rfeHwPdc_effectiveSamplingFrequency_160MHz_e;

RFE_ERROR_GUARD
{
    switch ( customerSamplingRate )
    {
        case rfe_effectiveSamplingFrequency_40MHz_e:
            dftSamplingRate = rfeHwPdc_effectiveSamplingFrequency_40MHz_e;
            break;
        case rfe_effectiveSamplingFrequency_20MHz_e:
            dftSamplingRate = rfeHwPdc_effectiveSamplingFrequency_20MHz_e;
            break;
        case rfe_effectiveSamplingFrequency_10MHz_e:
            dftSamplingRate = rfeHwPdc_effectiveSamplingFrequency_10MHz_e;
            break;
        default:
            RFE_ERROR_SET( rfe_error_pcdSamplingFrequencyInvalid_e );
            break;
    }
}
return dftSamplingRate;

if ( ( outputSamplingRate == rfeHwPdc_effectiveSamplingFrequency_160MHz_e ) && RFE_ERROR_IS_NO_ERROR )
{
    RFE_ERROR_SET( rfe_error_pcdSamplingFrequencyInvalid_e );
}
else
{
    // carry on
}
// Enable multicast SPI in PDC
bool useMulticast = true;
// Dummy index to indicate from where to read the config that is going to be distributed to the rest of PDCs via multicast
rfe_rxIndex_t selectedPdc = rfe_rxIndex_1_e;

// Enable multicast SPI write
rfeHwPdc_multicastModeSetter( useMulticast,
                              RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Struct for phase correction
    rfeHwPdc_phaseCorrection_t phaseCorrection;
    // Structs for Equalizer coeffs
    rfeHwPdc_equalizerCoeffs eqCoeffs;
    rfeHwPdc_equalizerCoeffs *pEqCoeffs = &eqCoeffs;

    // Select the PDC to use
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( selectedPdc,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );

    // Read PDC CTL register to set phase amplitude correction
    rfeHwSpi_register32_t pdcPhAmpCorr = rfeHwSpi_read( pdcAddrSPI,
                                                        RFE_HW_PDC_COMMON_PHAMP_COR_REG_OFFSET( profileIndex ),
                                                        RFE_ERROR_FUNCTION_ARGUMENT );

    // Save current level adjustment to avoid overriding it
    phaseCorrection.pdcLevelAdjustment = rfeHwPdc_getValueThroughMask( pdcPhAmpCorr,
                                                                       RFE_HW_PDC_COMMON_PHAMP_COR_LEVEL_ADJ_MSK,
                                                                       RFE_HW_PDC_COMMON_PHAMP_COR_PDC_LEVEL_ADJ_SHF );
    // Update the phase correction values
    phaseCorrection.pdcPhaseCorrection_I = ( filterMode == rfeHwPdc_filterMode_steepNarrowBand_e ) ? steepNarrowBandModeCorrections[( uint8_t ) outputSamplingRate][RFE_HW_PDC_CORRECTION_MATRIX_PHASE_COR_I_INDEX]
                                                                                                   : narrowBandModeCorrections[( uint8_t ) outputSamplingRate][RFE_HW_PDC_CORRECTION_MATRIX_PHASE_COR_I_INDEX];
    phaseCorrection.pdcPhaseCorrection_Q = ( filterMode == rfeHwPdc_filterMode_steepNarrowBand_e ) ? steepNarrowBandModeCorrections[( uint8_t ) outputSamplingRate][RFE_HW_PDC_CORRECTION_MATRIX_PHASE_COR_Q_INDEX]
                                                                                                   : narrowBandModeCorrections[( uint8_t ) outputSamplingRate][RFE_HW_PDC_CORRECTION_MATRIX_PHASE_COR_Q_INDEX];

    // Write new phase correction using multicast
    rfeHwPdc_phaseCorrectionSetter( selectedPdc,
                                    profileIndex,
                                    phaseCorrection,
                                    RFE_ERROR_FUNCTION_ARGUMENT );
    // Update the Equalizer coeffs
    pEqCoeffs->k0xa1 = equalizerCoefficients[( uint8_t ) outputSamplingRate][RFE_HW_PDC_EQ_COEFF1_MATRIX_INDEX];
    pEqCoeffs->k0xa0Real = equalizerCoefficients[( uint8_t ) outputSamplingRate][RFE_HW_PDC_EQ_COEFF2_MATRIX_INDEX];
    pEqCoeffs->k0xa0Imag = equalizerCoefficients[( uint8_t ) outputSamplingRate][RFE_HW_PDC_EQ_COEFF3_MATRIX_INDEX];
    // Write new eq coeffs using multicast
    rfeHwPdc_equalizerCoeffsSetter( selectedPdc,
                                    profileIndex,
                                    eqCoeffs,
                                    RFE_ERROR_FUNCTION_ARGUMENT );

}

// Disable multicast SPI write
rfeHwPdc_multicastModeSetter( !useMulticast,
                              RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwSpi_register32_t pdcCtl0RegisterValue = 0ul;
rfeHwSpi_register32_t pdcEq1RegisterValue = 0ul;

RFE_ERROR_GUARD
{
    //Step3: pdc_init_40msps
    rfeHw_profileIndex_t profileId;
    rfeHwSpi_offset_t registerOffset = 0ul;
    // Update ICQ
    rfeHwPdc_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
    rfe_rxIndex_t pdcIndex = rfe_rxIndex_1_e;
    rfeHwPdc_equalizerCoeffs equalizerCoeffs;
    equalizerCoeffs.k0xa1      = RFE_HW_PDC_SW_INIT_EQ_COEFF1  ;
    equalizerCoeffs.k0xa0Real  = RFE_HW_PDC_SW_INIT_EQ_COEFF2  ;
    equalizerCoeffs.k0xa0Imag  = RFE_HW_PDC_SW_INIT_EQ_COEFF3  ;
    for ( profileId = rfeHw_profileIndex_0_e; profileId <= rfeHw_profileIndex_bist_e; profileId++ )
    {
        rfeHwPdc_equalizerCoeffsSetter( pdcIndex,
                                        profileId ,
                                        equalizerCoeffs,
                                        RFE_ERROR_FUNCTION_ARGUMENT );

        rfeHwPdc_iqcCorrectionSetter( pdcIndex,
                                      profileId,
                                      RFE_HW_PDC_IQC_CORRECTION_AMPLITUDE_AT_16P9_DEGREES,
                                      RFE_HW_PDC_IQC_CORRECTION_PHASE_AT_16P9_DEGREES,
                                      RFE_ERROR_FUNCTION_ARGUMENT );

    }
    rfeHwPdc_multicastModeSetter( false, RFE_ERROR_FUNCTION_ARGUMENT );
    // enable DECI1 HOLD
    rfeHwSpi_modifyBit( RFE_HW_SPI_PDC_MC_MODULE,
                        RFE_HW_PDC_PDC_PDC_OL_CNT_REG,
                        RFE_HW_PDC_PDC_PDC_OL_CNT_DECI1_HLD_DIS_BIT,
                        false,
                        RFE_ERROR_FUNCTION_ARGUMENT );

}

// Aux value not to modify orignal
rfeHwSpi_register32_t registerValueToGet = pdcRegWithValue;

registerValueToGet = ( registerValueToGet & maskToApply ) >> shiftToApply;

return registerValueToGet;
